import React from 'react';
import Album from '../Album';

const SearchResults = ({ albums, onAddToLibrary }) => {
  return (
    <section className='searchResults'>
      <h2>Resultados de b√∫squeda</h2>
      {albums.map(album => (
        <Album
          key={album.id}
          {...album}
          onAdd={onAddToLibrary}
        />
      ))}
    </section>
  );
};

export default SearchResults;
